import { useEffect, useState } from "react";
import UseCustomFetch from "./shared/customFetch";

const App = () => {
  const [loading, setIsLoading] = useState(true);
  const [responseData, setData] = useState(null);

  useEffect(() => {
    let url = "https://swapi.dev/api/people/1";
    const { isLoading, error, data } = UseCustomFetch(url);
    setIsLoading(isLoading);
    setData(data);
  }, []);

  return (
    <div className="App">
      {!loading && responseData ? (
        <div>{responseData.name}</div>
      ) : (
        "Loading...."
      )}
    </div>
  );
};
export default App;
